      <div className="col-lg-6">
        <h1>Build Grow</h1>
        <h1>Scale Win</h1>
      </div>
      <div className="col-lg-6">

        <h1>Scale Win</h1>
      </div>
    </div>
  </Layout>
);

export default Index;
